<!DOCTYPE html><html lang="en">    <head>        <meta name="description" content="Ogani Template">        <meta name="keywords" content="Ogani, unica, creative, html">        <meta name="viewport" content="width=device-width, initial-scale=1.0">        <meta http-equiv="X-UA-Compatible" content="ie=edge">        <title>Vegan Store</title>        <!-- Google Font -->        <link href="https://fonts.googleapis.com/css2?family=Cairo:wght@200;300;400;600;900&display=swap" rel="stylesheet">        <!-- Css Styles -->        <link rel="stylesheet" href="css/bootstrap.min.css" type="text/css">        <link rel="stylesheet" href="css/font-awesome.min.css" type="text/css">        <link rel="stylesheet" href="css/elegant-icons.css" type="text/css">        <link rel="stylesheet" href="css/nice-select.css" type="text/css">        <link rel="stylesheet" href="css/jquery-ui.min.css" type="text/css">        <link rel="stylesheet" href="css/owl.carousel.min.css" type="text/css">        <link rel="stylesheet" href="css/slicknav.min.css" type="text/css">        <link rel="stylesheet" href="css/style.css" type="text/css">        <link rel="stylesheet" href="./css_signin_signout/css/style.min.css">    </head>    <body>        <div class="layer"></div>        <main class="page-center">            <article class="sign-up">                <h1 class="sign-up__title">Welcome back!</h1>                <p class="sign-up__subtitle">Sign in to your account to continue</p>                <form class="sign-up-form form" action="" method="">                    <label class="form-label-wrapper">                        <p class="form-label">Email</p>                        <input class="form-input" type="email" placeholder="Enter your email" required>                    </label>                    <label class="form-label-wrapper">                        <p class="form-label">Password</p>                        <input class="form-input" type="password" placeholder="Enter your password" required>                    </label>                    <a class="link-info forget-link" href="##">Forgot your password?</a>                    <label class="form-checkbox-wrapper">                        <input class="form-checkbox" type="checkbox" required>                        <span class="form-checkbox-label">Remember me next time</span>                    </label>                    <button class="form-btn primary-default-btn transparent-btn">Sign in</button>                </form>            </article>        </main>        <!-- Chart library -->        <script src="./plugins/chart.min.js"></script>        <!-- Icons library -->        <script src="plugins/feather.min.js"></script>        <!-- Custom scripts -->        <script src="js/script.js"></script>    </body></html>